/* 8. Implementazione delle interrogazioni del carico di lavoro, ulteriori interrogazioni, vista e 
riscritture in accordo con il tuning delle interrogazioni */


/* 8.1. Determinare l'identificatore dei giochi che coinvolgono al più quattro squadre e richiedono l'uso di due dadi. */

SELECT id
FROM Gioco
WHERE max_squadre = 4 AND dadi_richiesti = 2;

/* 8.2. Determinare l'identificatore delle sfide relative a un gioco A di vostra scelta che, in alternativa: o hanno avuto luogo a gennaio 2021 e 
durata massima superiore a 2 ore, o hanno avuto luogo a marzo 2021 e durata massima pari a 30 minuti. */

SELECT id
FROM Sfida
WHERE gioco = 6 AND ((data BETWEEN '01/01/2021' AND '31/01/2021' AND durata_max > 120) OR (data BETWEEN '01/03/2021' AND '31/03/2021' AND durata_max = 30));

/* 8.3. Determinare le sfide, di durata massima superiore a 2 ore, dei giochi che richiedono almeno due dadi. Restituire sia l'identificatore della 
sfida sia l'identificatore del gioco. */

SELECT Sfida.id, gioco
FROM Sfida JOIN Gioco ON gioco = Gioco.id
WHERE durata_max > 120 AND dadi_richiesti >= 2;

/* 8.4. Determinare i giochi che contengono caselle a cui sono associati task. */

SELECT DISTINCT Gioco.id
FROM Gioco JOIN Casella_di_gioco Z ON Gioco.id = gioco
WHERE EXISTS (SELECT Numero
				 FROM Casella_di_gioco
				 WHERE task IS NOT NULL AND Gioco = Z.Gioco);

/* 8.5. Determinare i giochi che non contengono caselle a cui sono associati task. */

SELECT DISTINCT Gioco.id
FROM Gioco JOIN Casella_di_gioco Z ON Gioco.id = gioco
WHERE NOT EXISTS (SELECT Numero
				 FROM Casella_di_gioco
				 WHERE task IS NOT NULL AND Gioco = Z.Gioco);

/* 8.6. Determinare le sfide che hanno durata superiore alla durata media delle sfide relative allo stesso gioco. */

SELECT id
FROM Sfida Z
WHERE durata_max > (SELECT AVG(durata_max)
					FROM Sfida
					WHERE Z.gioco = gioco);
					
/* 8.7. Vista che fornisce alcune informazioni riassuntive per ogni gioco: il numero di sfide relative a quel gioco disputate, 
la durata media di tali sfide, il numero di squadre e di giocatori partecipanti a tali sfide, i punteggi minimo, medio e massimo 
ottenuti dalle squadre partecipanti a tali sfide. */

CREATE VIEW Info_riassuntive_giochi AS
SELECT Gioco.id, COUNT(Sfida.id) AS Sfide_disputate, AVG(Sfida.durata_max) AS Durata_media, COUNT(Squadra.nome_squadra) AS Squadre_partecipanti,
COUNT(Utente.email) AS Giocatori_partecipanti, MIN(Punteggio.punti_tot) AS Punteggio_minimo, AVG(Punteggio.punti_tot) AS Punteggio_medio,
MAX(Punteggio.punti_tot) AS Punteggio_massimo
FROM Gioco JOIN Sfida ON Gioco.id = Sfida.gioco JOIN Punteggio ON Sfida.id = Punteggio.sfida JOIN Squadra ON Punteggio.squadra = Squadra.nome_squadra
JOIN Composizione_squadra ON Squadra.nome_squadra = Composizione_squadra.squadra JOIN Utente ON Composizione_squadra.utente = Utente.email
GROUP BY Gioco.id;

/* 8.8. Riscrittura di 8.4 in accordo con il tuning delle interrogazioni (ossia no sottointerrogazione e no distinct). */

SELECT Gioco.id
FROM Gioco JOIN Casella_di_gioco ON Gioco.id = Casella_di_gioco.gioco
WHERE task IS NOT NULL
GROUP BY Gioco.id
HAVING COUNT(Numero) != 0;

/* 8.9. Riscrittura di 8.7 in accordo con il tuning delle interrogazioni (uso di vista materializzata). */

CREATE MATERIALIZED VIEW Info_riassuntive_giochi_mat AS
SELECT Gioco.id, COUNT(Sfida.id) AS Sfide_disputate, AVG(Sfida.durata_max) AS Durata_media, COUNT(Squadra.nome_squadra) AS Squadre_partecipanti,
COUNT(Utente.email) AS Giocatori_partecipanti, MIN(Punteggio.punti_tot) AS Punteggio_minimo, AVG(Punteggio.punti_tot) AS Punteggio_medio,
MAX(Punteggio.punti_tot) AS Punteggio_massimo
FROM Gioco JOIN Sfida ON Gioco.id = Sfida.gioco JOIN Punteggio ON Sfida.id = Punteggio.sfida JOIN Squadra ON Punteggio.squadra = Squadra.nome_squadra
JOIN Composizione_squadra ON Squadra.nome_squadra = Composizione_squadra.squadra JOIN Utente ON Composizione_squadra.utente = Utente.email
GROUP BY Gioco.id;


/* 9. Implementazione in PL/pgSQL di funzioni e procedure richieste */


/* 9.1. Determinare le sfide che hanno durata superiore alla durata medie delle sfide di un dato gioco, prendendo come parametro l'ID del gioco */

CREATE FUNCTION Function1(IN gioco_search DECIMAL(5,0), OUT sfide INTEGER) LANGUAGE plpgsql AS
	$$
	DECLARE
		gioco_find DECIMAL(5,0);
	BEGIN
		SELECT id INTO gioco_find --cerca il gioco richiesto--
		FROM Gioco
		WHERE id = gioco_search;
		IF gioco_search IS NULL THEN RAISE NOTICE 'Gioco non esistente'; --se non e' presente solleva un'eccezione--
		ELSE SELECT id INTO sfide
		FROM Sfida Z
		WHERE gioco = gioco_find AND durata_max > (SELECT AVG(durata_max) --altrimenti esegue la richiesta sul gioco--
													FROM Sfida
													WHERE gioco = gioco_find);
		END IF;
	END;
	$$;
	
/* 9.2. Funzione di scelta dell'icona da parte di una squadra in una sfida: possono essere scelte solo le icone corrispondenti al gioco cui 
si riferisce la sfida che non siano già state scelte da altre squadre. */

CREATE FUNCTION Function2(gioco_s DECIMAL(5,0), sfida_s DECIMAL(5,0), squadra_s VARCHAR(30), icona_s VARCHAR(30), set_s VARCHAR(30)) 
RETURNS void LANGUAGE plpgsql AS
	$$
	DECLARE
		gioco_find DECIMAL(5,0);
		sfida_find DECIMAL(5,0);
		squadra_find VARCHAR(30);
		icona_find VARCHAR(30);
		set_find VARCHAR(30);
		set_game VARCHAR(30);
		already_used VARCHAR(30);
	BEGIN
		SELECT id INTO gioco_find --si controlla che esistono gioco, sfida, squadra e icona--
		FROM Gioco
		WHERE id = gioco_s;
		IF gioco_find IS NULL THEN RAISE EXCEPTION 'Gioco non esistente';
		ELSE SELECT id INTO sfida_find
		FROM Sfida
		WHERE id = sfida_s;
		IF sfida_find IS NULL THEN RAISE EXCEPTION 'Sfida non esistente';
		ELSE SELECT nome_squadra INTO squadra_find
		FROM Squadra
		WHERE nome_squadra = squadra_s;
		IF squadra_find IS NULL THEN RAISE EXCEPTION 'Squadra non esistente';
		ELSE SELECT nome_icona, nome_set INTO icona_find, set_find
		FROM Icona
		WHERE nome_icona = icona_s AND nome_set = set_s;
		IF icona_find IS NULL OR set_find IS NULL THEN RAISE EXCEPTION 'Icona non esistente';
		ELSE SELECT set_icone INTO set_game --se il set di icone esiste potrebbe non essere utilizzato dal gioco--
		FROM Gioco
		WHERE set_icone = set_find AND id = gioco_find;
		IF set_game IS NULL THEN RAISE EXCEPTION 'Questo gioco non utilizza il set di icone scelto!';
		ELSE SELECT squadra INTO already_used --oppure potrebbe essere gia' in uso da una squadra--
		FROM Punteggio JOIN Squadra ON squadra = nome_squadra
		WHERE sfida = sfida_find AND nome_icona = icona_find AND nome_set = set_find;
		IF already_used IS NOT NULL THEN RAISE EXCEPTION 'Icona gia in uso da una squadra';
		ELSE UPDATE Squadra --se i controlli precedenti vengono tutti passati si imposta l'icona scelta--
		SET nome_icona = icona_find, nome_set = set_find 
		WHERE nome_squadra = squadra_find;
		END IF;
		END IF;
		END IF;
		END IF;
		END IF;
		END IF;
	END;
	$$;
	
