/* 10. Implementazione in PL/pgSQL dei trigger richiesti */


/* 10.1. Verifica del vincolo che nessun utente possa partecipare a sfide contemporanee. */

CREATE FUNCTION trigger1() RETURNS TRIGGER LANGUAGE PLPGSQL AS 
	$$
	DECLARE
		Usr VARCHAR(30);
	BEGIN
   		SELECT DISTINCT Email INTO Usr --cerca gli utenti iscritti a sfide che cominciano nella stessa data e ora--
		FROM Utente X JOIN Composizione_squadra Y ON Email = Utente JOIN Squadra Z ON Squadra = Nome_Squadra JOIN Punteggio W ON Nome_Squadra = W.Squadra
		JOIN Sfida V ON Sfida = id
		WHERE Data = ANY (SELECT Data
			 				FROM Utente JOIN Composizione_squadra ON Email = Utente JOIN Squadra ON Squadra = Nome_Squadra JOIN Punteggio ON Nome_Squadra = Punteggio.Squadra
							JOIN Sfida ON Sfida = id
			 				WHERE id <> V.id AND Email = X.Email) AND Ora = ANY (SELECT Ora
											 									FROM Utente JOIN Composizione_squadra ON Email = Utente JOIN Squadra ON Squadra = Nome_Squadra JOIN Punteggio ON Nome_Squadra = Punteggio.Squadra
																				JOIN Sfida ON Sfida = id
											 									WHERE id <> V.id AND Email = X.Email);
   		IF Usr IS NOT NULL THEN RAISE EXCEPTION 'Un utente non puo partecipare a sfide contemporanee!'; --risultato che dev'essere vuoto--
   		ELSE RETURN NEW;
   		END IF;
	END;
	$$;
	
CREATE TRIGGER Trigger1
AFTER INSERT OR UPDATE ON Punteggio --il trigger si attiva dopo tentati inserimenti o aggiornamenti in partecipazioni di squadre a sfide--
FOR EACH ROW
EXECUTE PROCEDURE trigger1();

/* 10.2. Mantenimento del punteggio corrente di ciascuna squadra in ogni sfida e inserimento delle icone opportune nella casella podio. */

CREATE FUNCTION trigger2() RETURNS TRIGGER LANGUAGE PLPGSQL AS 
	$$
	DECLARE
		lim INTEGER;
		first_sq VARCHAR(30);
		second_sq VARCHAR(30);
		third_sq VARCHAR(30);
		first_ico VARCHAR(30);
		second_ico VARCHAR(30);
		third_ico VARCHAR(30);
		gioco_f DECIMAL(5,0);
		set_ic VARCHAR(30);
	BEGIN 
   		UPDATE Punteggio --dopo il completamento di un turno, si aggiorna punteggio e numero di turni effettuati--
		SET Punti_tot = Punti_tot + NEW.Punteggio_ottenuto, Turni = Turni + 1
		WHERE Sfida = NEW.Sfida AND Squadra = NEW.Squadra;
		SELECT Limite_massimo INTO lim --anche il numero di dadi, purche' non si superi il limite massimo--
		FROM Sfida JOIN Info_dadi ON Sfida.gioco = Info_dadi.gioco
		WHERE id = NEW.Sfida;
		IF(SELECT Num_dadi FROM Punteggio WHERE Sfida = NEW.Sfida AND Squadra = NEW.Squadra) + NEW.Numero_dadi_ottenuti <= lim 
			THEN UPDATE Punteggio SET Num_dadi = Num_dadi + NEW.Numero_dadi_ottenuti WHERE Sfida = NEW.Sfida AND Squadra = NEW.Squadra;
		END IF;
		SELECT Squadra INTO first_sq --si cerca la squadra al primo posto--
		FROM Punteggio 
		WHERE Sfida = NEW.Sfida 
		ORDER BY Punti_tot DESC 
		LIMIT 1 
		OFFSET 0;
		SELECT Squadra INTO second_sq --si cerca la squadra al secondo posto--
		FROM Punteggio 
		WHERE Sfida = NEW.Sfida 
		ORDER BY Punti_tot DESC 
		LIMIT 1 
		OFFSET 1;
		SELECT Squadra INTO third_sq --si cerca la squadra al terzo posto--
		FROM Punteggio 
		WHERE Sfida = NEW.Sfida 
		ORDER BY Punti_tot DESC 
		LIMIT 1 
		OFFSET 2;
		SELECT Nome_icona INTO first_ico --si cercano le rispettive icone--
		FROM Squadra
		WHERE Nome_squadra = first_sq;
		SELECT Nome_icona INTO second_ico
		FROM Squadra
		WHERE Nome_squadra = second_sq;
		SELECT Nome_icona INTO third_ico
		FROM Squadra
		WHERE Nome_squadra = third_sq;
		SELECT Gioco INTO gioco_f
		FROM Sfida
		WHERE id = NEW.Sfida;
		SELECT Set_icone INTO set_ic
		FROM Gioco
		WHERE id = gioco_f;
		UPDATE Casella_podio --si aggiornano le rispettive caselle podio--
		SET Nome_icona = first_ico, Nome_set = set_ic
		WHERE Place = 1 AND Gioco = gioco_f;
		UPDATE Casella_podio
		SET Nome_icona = second_ico, Nome_set = set_ic
		WHERE Place = 2 AND Gioco = gioco_f;
		UPDATE Casella_podio
		SET Nome_icona = third_ico, Nome_set = set_ic
		WHERE Place = 3 AND Gioco = gioco_f;
		RETURN NEW;
	END;
	$$;
	
/*il trigger si attiva dopo un aggiornamento in quanto il turno va prima cominciato con la visista nella casella (INSERT) e poi completato
con rispettive risposte, punteggi e valore lancio dadi */

CREATE TRIGGER Trigger2
AFTER UPDATE ON Turno 
FOR EACH ROW
EXECUTE PROCEDURE trigger2();	

