INSERT INTO Task VALUES(00001, 'Si scriva un programma C (ed il relativo diagramma a blocchi) che legge da tastiera una sequenza di 10 numeri interi e, al termine, stampa a video il numero dei numeri letti che sono maggiori di zero, di quelli che sono minori di zero e di quelli nulli. ', 3);
INSERT INTO Task VALUES(00002, 'Si sviluppi un programma che acquisisce da tastiera un numero e ne calcola il fattoriale.', 4);
INSERT INTO Task VALUES(00003, 'Si implementi un programma che decide se un numero dato dall’utente è primo oppure no.', 5);
INSERT INTO Task VALUES(00004, 'Si legga una sequenza di numeri interi e se ne stampi il valore medio.', 3);
INSERT INTO Task VALUES(00005, 'Scrivere un programma che acquisisce da tastiera una sequenza di 10 interi, li memorizza in un array e, infine, ordina gli elementi contenuti nell’array', 4);
INSERT INTO Task VALUES(00006, 'Sviluppare un programma che acquisisce una sequenza di caratteri terminata dal carattere ‘#’ e stabilisce se la sequenza è palindrome oppure no', 5);
INSERT INTO Task VALUES(00007, 'Si sviluppi un programma che acquisisce da tastiera i valori di due vettori di 10 posizioni e calcola un nuovo vettore come risultato della somma tra i primi due.', 3);
INSERT INTO Task VALUES(00008, 'Si sviluppi un sottoprogramma che cerca una stringa in un elenco di stringhe. Il sottoprogramma restituisce un intero che rappresenta la posizione della stringa nell’elenco se questa esiste, e –1 in caso contrario.', 4);
INSERT INTO Task VALUES(00009, 'Si scriva un sottoprogramma che riceve come parametro un array di stringhe e le stampa a schermo in ordine alfabetico. ', 5);
INSERT INTO Task VALUES(00010, 'Si scriva un programma che riceve in input una stringa s (source) e una seconda stringa t (target). Il programma deve ricercare la stringa t all’interno della stringa s.', 3);
INSERT INTO Task VALUES(00011, 'Si scriva un programma che, ricevute in ingresso due stringhe str1 e str2, ne esegua la concatenazione (str1str2) e ne stampi a video il risultato. ', 4);
INSERT INTO Task VALUES(00012, 'Si scriva un programma che legge da un file di testo una sequenza di stringhe e le stampa sullo schermo', 5);
INSERT INTO Task VALUES(00013, 'Scrivere un programma che acquisisce una sequenza di interi da standard input e la salva su un file in modalità testo ', 3);
INSERT INTO Task VALUES(00014, 'Si scriva un programma che esegue la copia di un file di testo. Il programma legge carattere per carattere il contenuto del file "in.txt" e lo ricopia nel file "out.txt".', 4);
INSERT INTO Task VALUES(00015, 'Scrivete un programma che legge da un file di testo una sequenza di interi, la ordina in modo crescente e salva su file la sequenza risultate sovrascrivendo il vecchio contenuto. ', 5);
